goog.provide("goog.dom.InputTypeTest");goog.setTestOnly("goog.dom.InputTypeTest");goog.require("goog.dom.InputType");goog.require("goog.object");function testCorrectNumberOfInputTypes(){assertEquals(27,goog.object.getCount(goog.dom.InputType))}function testPropertyNamesEqualValues(){for(var propertyName in goog.dom.InputType){assertEquals(propertyName.lower().replace("_","-"),goog.dom.InputType[propertyName])}}function testTypes(){assertEquals("text",document.getElementById("textinput").type);assertEquals("time",document.getElementById("timeinput").type);assertEquals("textarea",document.getElementById("textarea").type);assertEquals("select-one",document.getElementById("selectone").type);assertEquals("select-multiple",document.getElementById("selectmultiple").type)}